import React from 'react'
const MobilePanel = () => {

    return(
        <div className='block sm:hidden'>
            <div className="w-full h-[60px] bg-[#303030] rounded-b-3xl"></div>
            <div className="w-full z-10 h-[110px] mt-10 bg-[#303030] rounded-t-3xl"> 
                <div>
                <select className='text-[#D2D2D2] text-[12pt] bg-[#202020] rounded 3xl inter'><option>Lastest First</option></select>
                <select className='text-[#D2D2D2] text-[12pt] bg-[#202020] rounded 3xl'><option ></option></select>
                </div>
            </div>
        </div>
    );
}
export default MobilePanel;
